INSERT INTO `disasters` VALUES (2,1,'Banjir','Membuat biopori dan sumur resapan, membuat peta evakuasi,','Membuat perencanaan tentang kebencanaan, bekerjasama dg bpbd setempat','Menyepelekan proses2 kesiapsiagaan bencana,','Air meluap menggenangi kelas','2020-12-19 11:39:01','2020-12-19 11:41:43'),(3,1,'Kekeringan','Memiliki sumber air pdam','Menanam pohon, membuat biopori, membuat tong2 air bersih tandon','Pasif','Tdk ada air baik dari sumur ,dan pdam mengalirnya sedikit /kecil','2020-12-19 11:44:02','2020-12-19 11:44:02'),(4,40,'Bencana Gunung Berapi','Lahan yang luas terutama RTH  berpotensi besar dalam mengurangi jumlah korban','1. Pemasangan jalur evakuasi\r\n2. Simulasi bencana alam\r\n3. Perencanaan Kegiatan Pasca bencana','JUmlah warga yang banyak rentan terjadinya korban','Lingkungan sekolah tertutup abu gunung berapi','2020-12-21 01:27:20','2020-12-21 01:27:20'),(5,47,'Angin ribut','Bangunan tertimpa pohon','Memanagkas ketinggian pohon','Tertimpa pohon','Pohon menimpa atap/genting bagunan sekolah','2020-12-21 09:40:33','2020-12-21 09:40:33'),(6,47,'Banjir dan genangan air','Halaman depan sekolah tergenang banjir','Membuat drainase','Parkir terganggu','merusak halaman sekolah','2020-12-21 09:42:57','2020-12-21 09:42:57'),(7,47,'Gunung merapi meletus','Abu Volkanik mengenaii bagunan','Menyiapakan alat lat kebrsihan','Sakit mata, batuk','Genting terkena debu volkanik','2020-12-21 09:45:11','2020-12-21 09:45:11'),(8,47,'Gempa volkanik gunung merapi','Retak bangunan','Membuat titik kumpul','Keruntuhan bagunan/atap','Genting bangunan rusak','2020-12-21 09:47:31','2020-12-21 09:47:31'),(12,57,'Gunung meletus','Sangat mungkin terjadi dan berpotensi','Mengadakan penyuluhan tanggap bencana kepada warga sekolah','Rentan terdampak','polusi udara,tanaman mati,merusak barang elektronik','2021-01-18 13:30:01','2021-01-18 13:30:01'),(13,49,'Banjir dan puting beliung','Punya prahu karet','Membersihkn sampah di sungai','Membuang sampah di sungai','Banjir','2021-02-03 20:37: