n  memiliki potensi untuk terkena banjir','Pembersihan aliran sungai/selokan, penanaman pohon, pembuatan lubang resapan (biopori)','Genangan air dapat menimbulkan perkembangan jentik - jentik dan berpotensi terkena Demam Berdarah','Akses ke sekolah menjadi terhambat dan kegiatan belajar mengajar terganggu','2021-02-17 07:14:53','2021-02-17 07:14:53'),(22,96,'tes bencana','kecil','sudah dilakukan','tidak terlalu','medium','2021-02-26 14:00:54','2021-02-26 14:00:54'),(23,56,'Banjir','Memiliki tinggi sekolah','Simulasi','Kurang sosialisasi','Banjir masuk kelas','2021-03-06 09:27:09','2021-03-06 09:27:09'),(25,93,'Angin Puting Beliung','sekolah memiliki struktur bangunan yang kuat dan kokoh','menanam pohon-pohon pemecah puting beliung','ancaman bencana puting beliung memberikan rasa tidak nyaman','pagar pembatas dan tempat parkir boroh','2021-03-10 02:47:36','2021-03-10 02:47:36'),(26,99,'Angin Puting Beliung','Bangunan sekolah lebih kokoh dan kuat','Simulasi bencana dan membuat peta evakuasi','Butuh pelatihan-pelatihan agar tidak panik','Hujan angin mematahkan pohon pohon di pinggir jalan','2021-03-11 12:26:55','2021-03-11 12:26:55'),(27,99,'Kebakaran','Fisik bangunan sekolah kuat, SOP kebakaran','Simulasi tanggap kebakaran \r\nSimulasi evakuasi','Kurang sadarnya sebagian warga sekolah atas potensi terjadinya kebakaran di lingk sekolah','Belum pernah terjadi','2021-03-13 23:25:25','2021-03-13 23:25:25');
