INSERT INTO `innovations` VALUES (1,'KOMPOSTING ORGANIK',1,'MEMBUAT KOMPOS DENGAN AKTIVATOR NON KIMIA DALAM WAKTU 1 MINGGU','IBU. MAYA ANGGINI , M.PD','MENGURANGI PENGGUNAAN ZAT KIMIA DAN MEMPERCEPAT PROSES DARI 1 BULAN MENJADI 1 MINGGU','DAPAT MENANGANI SAMPAH DENGAN CEPAT KERENA PROSES CEPAT','MUDAH,CEPAT TIDAK BERBAU TANPA ZAT KIMIA','2020-08-04 23:59:17','2020-08-04 23:59:17'),(2,'Panel surya',4,'Menghidupkan pompa greenhouse dengan tenaga surya','Ir. Edi sukendra, M.Pd','Hemat energi','Mengurangi beban daya listrik','Pompa hidup tenaga surya','2020-08-18 10:49:34','2020-08-18 10:49:34'),(3,'Burung Hantu',10,'Konservasi burung hantu','Susilo Atmojo, S.Pd','Menjaga kepunahan burung hantu perkotaan','Menambah ekosistem','Untuk materi pembelajaran','2020-08-18 10:52:10','2020-08-18 10:52:10'),(4,'Mobil Energi Matahari',29,'Membuat mobil dengan sumber penggerak energi matahari','Drs. Kresno Kuncahyo','Menghemat bahan bakar fosil','Mengurangi polusi udara','Bersih dari polusi','2020-12-16 19:05:59','2020-12-16 19:05:59'),(5,'Pemanen air hujan',42,'Membuat instalasi pemanen air hujan','Drs. Kresno Kuncahyo','Memnafaatkan air hujan','Memnafaatkan air hujan untuk  cuci, wudhu, penyiram tanaman dan kolam','Mendapatkan air bersih','2020-12-21 15:23:23','2020-12-21 15:23:23'),(6,'Pemanen air AC',42,'Membuat bak penampung air AC','Sri Murtono, S.Pd., M.Eng.','Memnafaatkan limbah air AC','Pengisi radiator, penyiram tanaman','Mendapatkan air suling/ bersih','2020-12-21 15:25:58','2020-12-21 15:25:58'),(7,'Komoposting alam',1,'Membuat pupuk organik super','Agus sungkono, s.pd','Mengolah sampah organik dengan cepat','Meningkatkan proses penyuburan tanah','Proses komposting lebih cepat','2021-01-09 12:56:29','2021-01-09 12:56:29'),(8,'Mobil Energi Matahari',29,'Membuat mobil hemat energi dan pameran pada hari kemerdekaan RI','Drs. Kresno Kuncahyo','Hemat Energi dan bebas polusi','Bebas polusi dan hemat BBM','Bebas polusi udara dan suara','2021-01-12 18:23:34','2021-01-12 18:23:34'),(9,'Panel surya',124,'Membuat panel surya','Drs. Kresno Kuncahyo','Pemanfaatan energi matahari','Heamat energi fosil dan penerangan','Hemat energi listrik','2021-01-12 18:26:25','2021-01-12 18:26:25'),(10,'Pemanen air hujan',29,'Membuat pemanen air hujan','Drs. Kresno Kuncahyo','Memnfaatkan air untuk cadangana kekeringan','Air Wudhu, cuci tangan, menyiran tanaman','Cadangan air selalu siap','2021-01-12 18:29:45','2021-01-12 18:29:45'),(11,'Mobil Energi Matahari',29,'Membuat mobil  energi matahari','Drs. Kresno Kuncahyo','Moibil hemat energi dan bebas polusi','Beabas polusi dan hemat energi','Bebas polusi dan  hemat energi','2021-01-12 18:37:26','2021-01-12 18:37:26'),(12,'Pemanfaatan sampah plastik',122,'membuat karya seni bunga plastik','Sri Yulianti, S.Pd.','Pemanfaatan sampah plastik','Bersih sampah plastik','Kuat dan tahan air','2021-01-12 18:41:51','2021-01-12 18:41:51'),(13,'Pengolah sampah organik dengan lalat hitam',134,'Mengolah sampah organik dengan lalat hitam','Eni TU','Mengolah sampah organik kantin','bebas sampah organik dan penghasil pupuk','Sampah cepat menjadi kompos, menghasilkan pakan ikan dan ternak','2021-01-12 18:45:48','2021-01-12 18:45:48'),(14,'Menu sehat dan seimbang',180,'1. Makan dengan menu seimbang','Yuliani','Memenuhi kebutuhan gizi yang seimbang sehingga warga sekolah selalu dalam keadaan sehat','Menggerakan anggota warga sekolah untuk lebih peduli terhadap makanan yang dikonsumsi','Memonitoring penyediaan menu-menu seimbang yang disediakan kantin','2021-02-09 23:32:57','2021-02-09 23:32:57'),(15,'Budaya Antri',179,'Antri saat jajan di kantin','Yuliani','Mengajarkan siswa untuk belajar sabar dan jujur','1. Lingkungan menjadi aman dan tetib\r\n2. Terjalin kerjasama antar warga sekolah','Menciptakan budaya antri, tertib dan kerukunan antar warga sekolah','2021-02-10 07:33:15','2021-02-10 07:33:15'),(16,'Tertib membuang sampah sesuai dengan golongannya',178,'Membuang sampah menurut golongannya','Ignasius Krisdianto','Mengajarkan warga sekolah untuk mengenai jenis – jenis sampah yang di buangnya.','1. Menciptakan lingkungan sekolah yang bersih.\r\n2. Pengolahan sampah sesuai dengan golongannya','Memanfaatkan sampah sesuai dengan golongannya','2021-02-10 08:17:53','2021-02-10 08:17:53'),(17,'Pemanfaatan lahan untuk penanaman',177,'Penanaman sayuran','Sri Purwanti Juli Setijaningsih','Mengajak setiap warga sekolah untuk dapat memenuhi sumber vitamin dan mineral bagi tubuh','Membiasakan warga sekolah untuk menyukai sayuran','Setiap sayuran yang ditanam bersifat organik','2021-02-10 12:44:49','2021-02-10 12:44:49'),(18,'Bank sampah',171,'Mengumpulkan dan menabung sampah','Rochim','1. Membantu menangani pengolahan sampah\r\n2. Menambah penghasilan dari hasil penjualan sampah','Menyadarkan warga sekolah tentang lingkungan sehat, bersih dan rapi','Pengumpulan sampah oleh siswa dan dijual di Green School','2021-02-10 12:50:35','2021-02-10 12:50:35'),(19,'Pemanfaatan lahan untuk penanaman budidaya ikan',175,'Budidaya ikan','Janu Tri N','Memenuhi kebutuhan protein hewani','Menggerakkan warga sekolah untuk gemar konsumsi ikan','Memanfaatkan lahan yang ada disekolah untuk budidaya ikan','2021-02-11 11:36:10','2021-02-11 11:36:10'),(20,'Wisata Sampah',276,'Study Tour bagi kelas 8 yang pembiayaannya melalui Bank Sampah, (tabungan Bank sampah)','Rony Febriyanto, S.Pd. dan Siti Rochani, S.Pd.','mengurangi pencemaran sampah daur ulang, menumbuhkan jiwa kewirausahaan siswa','akan berkurangnya masalah sampah di rumah ataupun di sekolah','1. mengurangi volumen sampah daur ulang\r\n2.  memberikan solusi bagi pembiayaan study tour bagi siswa','2021-03-10 05:23:04','2021-03-10 05:23:04'),(21,'Rempah Hati',281,'Kerajinan minuman dari rempah-rempah hasil tanaman di sekolah','Sri Wahyuni, S.Pd.','memanfaatkan hasil tanaman toga untuk minuman remah yang bisa dijualbelikan','1. Memanfaatkan halaman untuk tanaman rempah\r\n2. membuat minuman rempah-rempah','1. menciptakan minuman sehat bagi masyarakat\r\n2. menumbuhkan jiwa wirausaha','2021-03-10 05:36:17','2021-03-10 05:36:17'),(22,'Abon Lele',280,'pembuatan sosis dari daging ikan lele untuk dijualbelikan','Moh Mauluddin, S.Pd.','membuat abon dari ikan lele hasl ternak di sekolah','1. memanfaatkan ikan lele untuk olahan yang bergizi','1. menciptakan makanan yang bervariasi dan bergizi\r\n2. menumbuhkan wirausaha','2021-03-10 05:45:05','2021-03-10 05:45:05'),(23,'PANEN AIR HUJAN',163,'Teknik mengumpulkan dan menampung air hujan ke suatu tangki','Trigiyanta, S.Pd.','Untuk memanfaatkan air hujan agar lebih maksimal.','Mengurangi ketergantungan pada sumur sehingga melestarikan sumber air tanah.','Air hujan ditampung ke tangki khusus dan dimanfaatkan untuk banyak hal seperti menyiram tanaman.','2021-03-10 06:41:43','2021-03-10 06:41:43'),(24,'PANEL SURYA',157,'Memasang panel surya di atap sekolah','Tina Siwi Pambayun, S.Pd.','Sebagai sumber energi terbarukan untuk dimanfaatkan di berbagai keperluan.','Membantu mengurangi pemanasan global dan ramah lingkungan','Memanfaatkan sinar matahari yang diubah menjadi tenaga listrik.','2021-03-10 06:55:07','2021-03-10 06:55:07'),(25,'URBAN FARMING HIDROPONIK',160,'Cara bercocok tanam di wilayah perkotaan dengan memanfaatkan lahan atau tempat sempit.','Reni Sunarso, S.Pd.','Memanfaatka lahan sempit untuk mendapat hasil maksimal.','Lebih hemat media tanah dan penggunaan pestisida, serta penghasil oksigen.','Hasil produksi urban farming lebih sehat karena sangat minim dalam penggunaan bahan kimia.','2021-03-10 07:06:11','2021-03-10 07:06:11'),(26,'BIOREMEDIASI GREY WATER',163,'Air cuci tangan yang disaring untuk dimanfaatkan berbagai keperluan.','Trigiyanta, S.Pd.','Menghasilkan limbah sekali pakai tanpa menimbulkan kerugian atau masalah dan mencegah polusi.','Sumber air bersih dapat terjaga dengan baik dan mengurangi polusi air.','Air cuci tangan di sekolah diolah yang bermanfaat menumbuhkan tanaman dan dialirkan ke kolam ikan.','2021-03-10 07:25:08','2021-03-10 07:25:08'),(27,'Kompos kilat',324,'Membuat pupuk kompos dengan campuran aktivator khsus sehingga prosesnya lebih cepat 7 hari','wahyu adi','Agar siklus produksi komposting lebih cepat/pendek','Lebih mempercepat proses pengolahan lingkungan','Lebih cepat proses kompostingnya','2021-03-14 01:09:40','2021-03-14 01:09:40');
