INSERT INTO `work_groups` VALUES (1,1,1,NULL,'',1,'Triyana, S.Pd.','1. MEMBUAT PUPUK ORGANIK DARI SAMPAH ORGANIK,\n2. MONITORING PRODUKSI KOMPOS\n3. MERAWAT PERALATAN DN PERLENGKAPAN\n4. MEMBUAT LAPORAN KERJA\n5. MENSOSIALISASI KEPADA WARGA SEKOLAH\n6. MEMPUBLIKASIKAN KE MASYARAKAT UMUM\n7. MENSOSIALISASIKAN KE BEBERAPA MEDIA/PUBLIKASI,\nDLL','2020-08-04 12:22:50','2020-08-04 12:22:50'),(2,1,2,NULL,'',1,'Andiyana , S.Pd','Membuat kerajinan daur ulang dari sampah an organik','2020-08-13 01:45:15','2020-08-13 01:45:15'),(3,1,3,NULL,'',1,'Murni S.Pd','Menjual sampah anorganik deel','2020-08-13 01:46:20','2020-08-13 01:46:20'),(4,1,4,NULL,'',2,'Wandini, S.Pd','Gerakan hemat listrik, deel','2020-08-13 01:47:50','2020-08-13 01:47:50'),(5,1,9,NULL,'',3,'Anjas,S.Pd','Budidaya Hidroponik , deel','2020-08-13 01:49:06','2020-08-13 01:49:06'),(6,1,8,NULL,'',3,'Endang, S.Pd','Menanam obatobatan keluarga, deel','2020-08-13 01:50:24','2020-08-13 01:50:24'),(7,1,11,NULL,'',4,'Muhamad, S.Pd','Membuat lubang resapan biopori, S.Pd','2020-08-13 01:51:27','2020-08-13 01:51:27'),(8,1,13,NULL,'',4,'Saraswati.S.Pd','Melancarkan pengairan limbah di sekolah, Deel','2020-08-13 01:52:40','2020-08-13 01:52:40'),(9,1,15,NULL,'',5,'Mularjito,S.Pd','Mengurangi Sampah Plastik di Kantin','2020-08-13 01:54:04','2020-08-13 01:54:04'),(10,1,7,NULL,'',3,'Abi Pangestu, S.pd','Merawat taman dan kola sekolah','2020-08-13 01:54:57','2020-08-13 01:54:57'),(11,1,6,NULL,'',2,'abi mahendra','Aksi setiap jumaT','2020-10-07 12:23:05','2020-10-07 12:23:05'),(12,1,18,NULL,'',3,'Endang','membersihkan tia[ kamis','2020-10-07 12:30:06','2020-10-07 12:30:06'),(24,31,1,NULL,'Mengolah sampah organik menjadi pupuk tanaman',1,'Ahmad Syaifuddin, S.Pd.I.','1. Melakukan pemilahan Sampah\r\n2. Melakukan proses pembuatan kompos\r\n3. Memberikan pembinaan cara mendaur ulang sampah organik\r\n4. Pembinaan pemanfaatan hasil komposting','2020-12-16 18:07:27','2020-12-16 18:07:27'),(25,31,2,NULL,'Proses menjadikan bahan bekas menjadi bahan baru',1,'Ahmad Syaifuddi, S.Pd.','1. Memilah sampah \r\n2. Memproses sampah menjadi barang baru yang bermanfaat\r\n3. Membuat kreatifitas dari limbah plastic\r\n4. Membuat kreatifitas dari limbah kertas\r\n5. Mengembangkan ekonomi kreatif sekolah\r\n6. Pembinaan pemanfaatan barang bekas / sampah menjadi barang yang bermanfaat kepada seluruh warga sekolah','2020-12-16 18:15:36','2020-12-16 18:15:36'),(26,31,3,NULL,'Tempat pengumpulan sampah yang sudah dipilah-pilah',1,'Ahmad Syaifuddi, S.Pd.','1. Pembinaan tentang kesadaran seluruh warga sekolah akan pentingnya kebersihan lingkungan\r\n2. Menanggulangi masalah sampah dan  mengurangi jumlah sampah yang ada di lingkungan sekolah\r\n3. Pembinaan pemanfaatan sampah untuk dijadikan barang baru yang bermanfaat\r\n4. Pembinaan budaya membuang sampah pada tempatnya sesuai dengan jenis sampah','2020-12-16 18:25:34','2020-12-16 18:25:34'),(27,31,4,NULL,'Penggunaan listrik sesuai kebutuhan',2,'Jaka Prasetya, S.Si.','1. Penyuluhan hemat energi listrik\r\n2. Posterisasi hemat energi listrik\r\n3. Meningkatkan kesadaran warga sekolah dalam menghemat energi listrik\r\n4. Penyuluhan pentingnya hemat energi listrik yang baik dan benar','2020-12-16 18:34:56','2020-12-16 18:34:56'),(28,31,5,NULL,'Energi dari proses alam yang berkelanjutan',2,'Jaka Prasetya, S.Si.','1. Penyuluhan pemahaman tentang penggunaan energi terbarukan dalam kehidupan sehari-hari (Tenaga Surya, Tenaga Angin, panas bumi, tenaga air, uap dan biogas)\r\n2. Mengedukasi pemanfaatan energi terbarukan dalam kehidupan sehari-hari kepada semua warga sekolah','2020-12-16 18:44:27','2020-12-16 18:44:27'),(29,47,5,NULL,'Pemnafaatan energi matahari',2,'Drs. Kresno Kuncahyo','Pengembangan energi terbarukan','2020-12-16 18:59:41','2020-12-16 18:59:41'),(30,47,4,NULL,'Penghematan energi listrik',2,'Sri Murtono, S.Pd., M.Eng.','Penghematan energi listrik','2020-12-16 19:01:45','2020-12-16 19:01:45'),(31,46,2,NULL,'Mendaur ulang sampah di sekolah',1,'Tri Harjanto, S.Si.','Bertanggung jawab daur ulang sampah yang ada di sekolah','2020-12-17 16:02:06','2020-12-17 16:02:06'),(32,46,1,NULL,'Membuat kompos dari sampah sekolah dan sekitarnya',1,'Anton Sri Budaya, S.Pd.','Memproses sampah di lingkungan sekolah dan sekitarnya menjadi kompos yang telah dikemas, dilabeli dan siap digunakan.','2020-12-17 16:04:56','2020-12-17 16:04:56'),(33,46,8,NULL,'Pembibitan, penanaman dan perawatan toga',3,'Tri Harjanto, S.Si.','Membuat bibit toga, membuat media penanamannya, menanam toga dan merawatnya','2020-12-17 16:06:44','2020-12-17 16:06:44'),(34,46,4,NULL,'Penerapan program hemat listrik di sekolah',2,'Suratno, S.Pd.','Memberi label hemat listrik dan mengawal lampu menyala dan kran air saat tidak dibutuhkan','2020-12-17 16:08:49','2020-12-17 16:08:49'),(35,46,7,NULL,'Membuat dan merawat taman dan kolam',3,'Isnaini Sri Hidayah, S.Pd.','Merencanakan dan membuat kolam dan taman serta perawatannya','2020-12-17 16:10:13','2020-12-17 16:10:13'),(36,46,9,NULL,'Perawatan tanaman dan praktikum botani',3,'Tri Harjanto, S.Si.','Melakukan perawatan dan rehabilitasi tanaman serta menyediakan tempat praktikum botani','2020-12-17 16:12:48','2020-12-17 16:12:48'),(37,46,16,NULL,'Pengawasan kantin aman kesehatan',5,'Devi Afritasari, S.Pd.','Melakukan pengawasan dan sosialisasi kantin aman kesehatan','2020-12-17 16:14:38','2020-12-17 16:14:38'),(38,47,1,NULL,'Penanganan sampah organik',1,'Albert Rosian, S.Pd.','Membuat pupuk organik sampah daun','2020-12-17 18:05:53','2020-12-17 18:05:53'),(39,47,2,NULL,'Penangan sampah plastik',1,'Sri Yulianti, S.Pd.','Penganganan sampah plastik menjadi karya seni','2020-12-17 18:08:12','2020-12-17 18:08:12'),(40,47,3,NULL,'Pemanfaatan sampah',1,'Riyanto, S.Pd., M.Pd','Mengidentifikasi dan menilah sampah','2020-12-17 18:09:59','2020-12-17 18:09:59'),(41,47,6,NULL,'Mengedalikan emisi gas buang kendaraan siswa',2,'Drs. Sumbul Kusno','Memantau kondisi lingkugan terhadap emisi gas buang kendaraan','2020-12-17 18:15:06','2020-12-17 18:15:06'),(42,47,7,NULL,'Menata taman dan kolam',4,'Riyanto, S.Pd., M.Pd','Merawat , mengendalikan fungsi taman dan kolam','2020-12-17 18:19:18','2020-12-17 18:19:18'),(43,47,9,NULL,'Memanfaatkan green house untuk edukasi siswa',3,'Sri Murtono, S.Pd., M.Eng.','Memfungsikan gree house sebagai saraana pendidikan pertanian , peternakan','2020-12-17 18:22:39','2020-12-17 18:22:39'),(44,47,10,NULL,'Kelancaran fungsi sanitasi& drainase sekolah',4,'Nur Eksanto, S.Pd.','Memantau kelancaran funsi sanitasi dan drainase','2020-12-17 18:25:16','2020-12-17 18:25:16'),(45,40,1,NULL,'Mengolah sampah organik / dedaunan menjadi kompos',1,'Drs. Djumadi','1. Mengumpulkan sampah organik/ daun\r\n2. Mengolah menjadi kompos\r\n3. Mengemas hasil kompos\r\n4. memasarkan hasil kompos','2020-12-17 20:08:49','2020-12-17 20:08:49'),(46,40,2,NULL,'memilah dan memilih sampah untuk didaur ulang',1,'Enika Savitri SE.','1. Memilah dan memilih sampah yang dapat di daur ulang\r\n2. Mendaur ulang sampah terpilih dan terpilah menjadi produk kreasi\r\n3. Mengelola Galeri Kreasi Hasil Karya Siswa','2020-12-17 20:15:43','2020-12-17 20:15:43'),(47,40,4,NULL,'Penghematan Listrik di Sekolah',2,'Dani Setyawan S. Kom','Membiasakan anak- anak untuk menghemat penggunaan listrik di lingkungan sekolah.','2020-12-17 20:19:16','2020-12-19 14:21:11'),(48,40,9,NULL,'Pengelolaan Pembibitan dan Bengkel Tanaman',3,'Drs. Asmuri','1. Mengadakan pembibitan dari tanaman/ pohon yg ada di sekolah\r\n2. Memperbaiki dan merawat tanaman yg rusak\r\n3. Mengelola hasil pembibitan baik dipakai sekolah sendiri maupun dijual umum','2020-12-17 20:23:15','2020-12-17 20:23:15'),(49,40,11,NULL,'Pengelolaan Biopori dan sumur resapan',4,'Sri Warto, S.Pd','1. Merencanakan pembuatan biopori\r\n2. Membuat biopori\r\n3. Memanen kompos biopori secara berkala\r\n4.  Memeriksa kondisi  Biopori secara berkala\r\n5. Memeriksa Sumur Resapan \r\n6. melaporkan bila ada kerusakan pada sumur resapan\r\n7. Membuat daftar Biop[ori dan sumur resapan \r\n8. Sebagai petugas operasional alat Simulasi BIOPORI','2020-12-17 20:27:53','2020-12-17 20:27:53'),(50,40,8,NULL,'Pengelolaan TOGA',3,'Budiyana, S.Ag','1. Merencanakan lokasi TOGA\r\n2. Mengolah lahan TOGA\r\n3. Menanami lahan TOGA\r\n4. Merawat TOGA\r\n5. Memanen TOGA\r\n6. Membuat administrasi tentang Toga\r\n7. Membuat label tanaman TOGA','2020-12-17 20:30:42','2020-12-17 20:30:42'),(51,40,7,NULL,'Pengelolaan taman dan kolam sekolah',3,'Sudaryoko, S.Pd','1. Membuat  pembagian kavling taman\r\n2. Memonitor kondisi perawatan taman dan kolam\r\n3. Membuat daftar vegetasi tanaman dan pohon\r\n4. Membuat dokumen kegiatan\r\n5. Membuat inovasi  taman','2020-12-17 20:34:20','2020-12-17 20:34:20'),(52,40,10,NULL,'Pengelolaan Sanitasi dan drainase sekolah',4,'Sri Marsidik, S,Pd','1. Membagi kamar mandi ke kelas \r\n2. Membuat laporan hasil monitoring kamar mandi secara berkala/ 1 minggu sekali\r\n3. Mengerjakan administrasi','2020-12-17 20:38:12','2020-12-17 20:38:12'),(53,47,11,NULL,'Penanganan geanagan air lokal',4,'Albert Rosian, S.Pd.','Menyelesaikan genangan air lokal','2020-12-18 09:59:30','2020-12-18 09:59:30'),(54,47,12,NULL,'Penanganan Air Sekala besar',4,'Nur Eksanto, S.Pd.','Penagananan luapan air agar tidak banjir','2020-12-18 10:01:42','2020-12-18 10:01:42'),(55,47,13,NULL,'Kelancaran fungsi drainase',4,'Nur Eksanto, S.Pd.','Memantau kelancaran funsgsi drainase','2020-12-18 10:03:04','2020-12-18 10:03:04'),(56,47,16,NULL,'Higeinitas kantin',5,'Riyanto, S.Pd., M.Pd','Memantau kondisi kemanan higenitas makanan dan minuman','2020-12-18 10:04:58','2020-12-18 10:04:58'),(57,47,14,NULL,'Pemanfaatan plastik kantin',1,'Sri Yulianti, S.Pd.','Penaganan sampah menjadi bahan kratifitas','2020-12-18 10:06:43','2020-12-18 10:06:43'),(58,1,6,NULL,'Mematikan mesin di halaman sekolah',2,'Agus sungkono, s.pd','Membuat jadwal pelaksanaan mematikan mesin sebulan 2 x .','2020-12-19 08:51:14','2020-12-19 08:51:14'),(59,47,17,NULL,'Memantau produk jualan kantin',5,'Dra. Sri Lestari','Mema