2:30'),(98,25,5,NULL,'Konservasi Energi',2,'Agus Susanto, S.Ag','1. Mematikan dan mencabut saklar listrik alat elektronik bila sudah tidak digunakan.\r\n2. Mengatur suhu AC antara 24 – 26 C\r\n3. Memanfaatkan cahaya matahari pada siang hari\r\n4. Penggunaan peralatan hemat listrik\r\n5. Perawatan perawatan listrik\r\n6. Membersihkan lampu dan rumah lampu\r\n7. Pemanfaatan Sumber Energi Terbarukan\r\n8. Sehari tanpa kendaraan bermotor\r\n9. Penggunaan bahan bakar ramah lingkungan','2020-12-23 17:15:28','2020-12-23 17:15:28'),(99,25,16,NULL,'Kantin Sehat dan Ramah Lingkungan',5,'Sriandayani, S.Pd','1. Makanan dan minuman tanpa plastik sekali pakai di kantin sekolah\r\n2. Makanan dan minuman tanpa steroform di kantin sekolah\r\n3. Pembuatan Mading tentang kantin sehat dan lingkungan hidup','2020-12-23 17:19:36','2020-12-23 17:19:36'),(100,49,18,NULL,'Kebun dan hutan belajar',3,'Suwarso, S.pd','Merawat  kebun dan hutan','2021-01-02 02:17:40','2021-01-02 02:17:40'),(102,49,1,NULL,'Membuat pupuk organik',1,'Abi','Membuat pupuk kompos','2021-01-06 09:25:26','2021-01-06 09:25:26'),(103,49,2,NULL,'Membuat kerajinan plastik bekas',1,'Ima','Membuat busana daur ulang','2021-01-06 09:26:37','2021-01-06 09:26:37'),(106,57,1,NULL,'Mengolah sampah organik menjadi pupuk tanaman',1,'Ahmad Syaifuddi, S.Pd.','1. Melakukan pemilahan Sampah\r\n2. Melakukan proses pembuatan kompos\r\n3. Memberikan pembinaan cara mendaur ulang sampah organik\r\n4. Pembinaan pemanfaatan hasil komposting','2021-01-06 18:27:30','2021-01-06 18:27:30'),(107,57,2,NULL,'Proses menjadikan bahan bekas menjadi bahan baru',1,'Ahmad Syaifuddi, S.Pd.','1. Memilah sampah \r\n2. Memproses sampah menjadi barang baru yang bermanfaat\r\n3. Membuat kreatifitas dari limbah plastic\r\n4. Membuat kreatifitas dari limbah kertas\r\n5. Mengembangkan ekonomi kreatif sekolah\r\n6. Pembinaan pemanfaatan barang bekas / sampah menjadi barang yang bermanfaat kepada seluruh warga sekolah','2021-01-06 18:28:29','2021-01-06 18:28:29'),(108,57,3,NULL,'Tempat pengumpulan sampah yang sudah dipilah-pilah',1,'Ahmad Syaifuddi, S.Pd.','1. Pembinaan tentang kesadaran seluruh warga sekolah akan pentingnya kebersihan lingkungan\r\n2. Menanggulangi masalah sampah dan  mengurangi jumlah sampah yang ada di lingkungan sekolah\r\n3. Pembinaan pemanfaatan sampah untuk dijadikan barang baru yang bermanfaat\r\n4. Pembinaan budaya membuang sampah pada tempatnya sesuai dengan jenis sampah','2021-01-06 18:29:55','2021-01-06 18:29:55'),(109,57,4,NULL,'Penggunaan listrik sesuai kebutuhan',2,'Jaka Prasetya, S.Si.','1. Penyuluhan hemat energi listrik\r\n2. Posterisasi hemat energi listrik\r\n3. Meningkatkan kesadaran warga sekolah dalam menghemat energi listrik\r\n4. Penyuluhan pentingnya hemat energi listrik yang baik dan benar','2021-01-06 18:30:59','2021-01-06 18:30:59'),(110,57,5,NULL,'Energi dari proses alam yang berkelanjutan',2,'Jaka Prasetya, S.Si.','1. Penyuluhan pemahaman tentang penggunaan energi terbarukan dalam kehidupan sehari-hari (Tenaga Surya, Tenaga Angin, panas bumi, tenaga air, uap dan biogas)\r\n2. Mengedukasi pemanfaatan energi terbarukan dalam kehidupan sehari-hari kepada semua warga sekolah','2021-01-06 18:31:38','2021-01-06 18:31:38'),(111,57,6,NULL,'Mengurangi penggunaan mesin bahan bakar emisi',2,'Jaka Prasetya, S.Si.','1.	Menjadwalkan hari engin off di lingkungan sekolah\r\n2.	Mengurangi polusi udara karena gas emisi kendaraan di lingkungan sekolah\r\n3.	Mengukur kualitas udara di lingkungan sekolah','2021-01-06 19:03:08','2021-01-06 19:03:08'),(112,57,7,NULL,'pelestarian tanaman, hewan dan keindahan',3,'Wahyudi, S.Pd.','1. Pembibitan tanaman\r\n2. Pembibitan ikan\r\n3. merawat, menjaga, memelihara tanaman dan ikan\r\n4. Membuat tata ruang lingkungan yang asri, indah, nyaman\r\n5. Menjual dan pengadaan ikan dan tanaman','2021-01-12 15:17:44','2021-01-12 15:17:44'),(113,57,8,NULL,'Pemanfaatan tanaman obat',3,'Wahyudi, S.Pd.','1. Pembibitan tanaman\r\n2. Perawatan tanaman\r\n3. Pengolahan dan pemanf