ati','1. Menyiapkan media dan peralatan pembudidayaan Tanaman Obat Keluarga (TOGA)\r\n2. Menyiapkan bibit tanaman TOGA\r\n3. Menyiapkan label nama Tanaman Obat Keluarga (TOGA) beserta manfaatnya dari kaleng bekas\r\n4. Melakukan pemeliharaan dan pemanfaatan tanaman untuk bumbu masak dan obat','2021-02-16 06:29:50','2021-02-16 06:29:50'),(268,62,9,NULL,'Membudidayakan tanaman greenhouse',3,'Ning Kundarwati dan Ainun Fitroh','1. Pembibitan\r\n2. Pemeliharaan dengan memberikan vitamin\r\n3. Mengecek kondisi air dalam bak penampungan\r\n4. Mengecek kondisi tanaman secara berkala\r\n5. Memanen tanaman','2021-02-16 06:34:20','2021-02-16 06:34:20'),(269,69,1,NULL,'Mengolah sampah menjadi pupuk kompos',1,'Ponjtowati, S.Pd. M.Si','1. Memproduksi kompos melalui komposter\r\n2. Merawat proses komposting\r\n3. Memanen','2021-02-16 07:38:09','2021-02-16 07:38:09'),(270,62,4,NULL,'Membiasakan perilaku hemat energi listrik.',2,'Elly Dwiana Hendrawati, S.Pd, M.Pd','1. Mendata total sumber daya listrik.\r\n2. Mendata beban (daya pemakaian) dan konsumsi energi listrik (biaya).\r\n3. Mengumpulkan slip tagihan listrik beberapa bulan terakhir.\r\n4. Membuat stiker tentang perilaku hemat energi listrik.','2021-02-16 12:08:47','2021-02-16 12:08:47'),(271,62,5,NULL,'Memanfaatkan panel surya.',2,'Elly Dwiana Hendrawati, S.Pd, M.Pd','1. Memasang panel surya di atap green house.\r\n2. Memanfaatkan energi listrik yang dihasilkan oleh panel surya untuk menggerakkan pompa air yang diarahkan ke green house dan kolam lele (sirkulasi air).','2021-02-17 01:34:33','2021-02-17 01:34:33'),(272,62,3,NULL,'Mengumpulkan sampah anorganik',1,'Muslimin, S.Pd.','1. Memilah sampah anorganik\r\n2. membuatkan akun nasabah\r\n2. mengumuplkan sampah anorganik dari nasabah\r\n3. Mencatat semua transaksi baik setoran nasabah maupun penjualan sampah\r\n4. Memasukkan catatan administrasi bank sampah ke web banksampah.online\r\n5. Menjual sampah anorganik ke pengepul','2021-02-17 02:10:08','2021-02-17 02:10:08'),(273,62,11,NULL,'Untuk mengatasi genangan air',4,'1. Sigit Yulianto, S.Pd','1. Membuat lubang biopori disekitar sekolah\r\n2. Memasukkan sampah daun untuk dijadikan sampah organik\r\n3. Mengolah sampah anorganik menjadi sampah organik','2021-02-22 02:28:36','2021-02-22 02:28:36'),(274,62,10,NULL,'Menyusunan perencanaan sanitasi',4,'Drs. Sumarma','1. Koordinasi dengan wali kelas, siswa, dan petugas tata laksana dalam rangka perawatan saluran air\r\n2. Pembenahan saluran air dan pemanfaatan air limbah\r\n3. Mengkampling tanggung jawab pengawasan selokan bagi anggota pokja','2021-02-24 04:29:04','2021-02-24 04:29:04'),(275,93,1,NULL,'Mengubah sampah menjadi pupuk',1,'Sutarmi, S.Pd','Program ini meliputi kegiatan pemilahan sampah, yaitu sampah organik diolah menjadi kompos , sedangkan sampah anorganik dikumpulkan untuk didaur ulang menjadi kerajinan tangan atau dijual. Tujuannya untuk mengurangi volume Sampah yang keluar dari sekolah.','2021-02-24 05:42:55','2021-02-24 05:42:55'),(276,93,3,NULL,'Mengumpulkan dan memilah sampah',1,'Widadi T.S, S.Pd','mengkoordinir seluruh tim pemilah sampah, baik bank sampah, hingga pengelola sampah kelas untuk melakukan pengumpulan, pemilahan, dan pembersihan','2021-02-24 05:45:44','2021-02-24 05:45:44'),(277,93,2,NULL,'Mengubah sampah menjadi lebih bermanfaat',1,'Suparno, S.Pd','Mengarahkan kepada siswa bahwa tidak selamany limbah sampah akan menjadi sampah yang berguna\r\nMemberi arahan kepada siswa mengenai salah satu cara pemanfaatan limbah menjadi barang bernilai tinggi\r\nMembentuk karakter peduli lingkungan terutama pada masalah pemanfaatan limbah.','2021-02-24 05:48:42','2021-02-24 05:48:42'),(278,93,4,NULL,'Mengajarkan untuk menggunakan energi secukupnya',2,'Ir. Farida Ariani Budiutami','Mengupayakan pemakaian / pemanfaatan teknologi hemat energi dan tepat guna \r\nMengalokasikan dana untuk pelaksanaan penghematan energi dan air serta pengelolaan lingkungan hidup.','2021-02-24 05:51:24','2021-02-24 05:51:24'),(279,93,5,NULL,'Memanfaatkan  energi alam yang berkelanjutan',2,'Tri Widati, SE','Mengembangkan dari berbagai sumber daya yang sudah ada','2021-02-24 05:56:51','2021-02-24 05:56:51'),(280,93,7,NULL,'Membuat taman dan kolam indah',3,'Drs. Lilik Sumaryanto','Memperbaiki dan memperindah taman dan kolam','2021-02-24 05:58:49','2021-02-24 05:58:49'),(281,93,8,NULL,'menanami dan mengelola kebun Toga',3,'Sri wahyuni, S.Pd','menanami dan mengelola kebun Toga','2021-02-24 06:00:33','2021-02-24 06:00:33'),(282,93,9,NULL,'Menciptakan suasana sekolah yang asri',3,'Dra. Nur Aliyah','Membuat taman green house yang asri','2021-02-24 06:06:46','2021-02-24 06:06:46'),(283,93,10,NULL,'menumbuhkan keanekaragaman hayati yang higienis',4,'Hariadi Praptono W, S.Pd, M.Pd','Menciptakan sanitasi air yang bersih','2021-02-24 06:09:33','2021-02-24 06:09:33'),(284,93,11,NULL,'Membuat drainase yang baik',4,'Ahmad yani, S.Pd','Peningkatan daya resap air pada tanah dilakukan dengan membuat lubang pada tanah dan menimbunnya dengan sampah organik untuk menghasilkan kompos','2021-02-24 06:11:51','2021-02-24 06:11:51'),(285,80,11,NULL,'Mengatasi sekolah dari genangan air',4,'Arif Setiawan, Dina Fariani','a. Menentukan bagian\r\nsekolah yang\r\nmembutuhkan lubang\r\nbiopori\r\nb. Membuat lubang biopori\r\nc.\r\nMengecek,membersihkan\r\nlubang biopori','2021-02-24 07:10:22','2021-02-24 07:10:22'),(286,80,13,NULL,'Memastikan drainase sekolah berfungsi baik',4,'Edy Siswanto,Farida kristiyaningsih','a. Mengecek berfungsinya\r\ndrainase sekolah\r\nb. Merencanakan perbaikan\r\ndrainase jika ada yang\r\nrusak','2021-02-24 07:12:45','2021-02-24 07:12:45'),(287,80,10,NULL,'Penyediaan air,jamban,pembuangan sampah dan limbah',4,'Wahyuni,Evi Hidayati','a. Memastikan jamban berfungsi baik\r\nb. Mengecek sarana air bersih,jamban,pembuangan  air limbah secara berkala\r\nc. Membuat perencanaan pemeliharaan sanitasi \r\nd. Program kamar mandi asuh yang dilakukan oleh seluruh siswa','2021-02-24 07:43:05','2021-02-24 07:43:05'),(288,80,2,NULL,