2'),(311,56,11,NULL,'Lubang resapan air',4,'Mularjito,S.Pd','Membuat biopori, merawat,memanen','2021-03-06 22:49:44','2021-03-06 22:49:44'),(314,97,3,NULL,'rtew',1,'guru pembimbing 2','dsads','2021-03-08 16:27:57','2021-03-10 09:42:25'),(316,88,21,NULL,'Menyediakan menu makanan sehat khas lokal',5,'Sulis','Mengecek ketersediaan bahan baku','2021-03-09 17:58:20','2021-03-09 17:58:20'),(317,76,6,NULL,'Pokja yang bertugas menangani masalah energi',2,'Endah Susilowati, S.Pd','•	Mencek secara rutin peralatan listrik yang ada di sekolah\r\n•	Mendata dan mencatat penggantian peralatan listrik yang rusak\r\n•	Mendata pengeluaran penggunaan listrik tiap bulannya\r\n•	Mengadakan peralatan-peralatan listrik yang ramah lingkungan dan hemat energy (berlabel eco green dan Save energy)\r\n•	Mendokumentasikan setiap kegiatan yang dilakukan','2021-03-10 01:57:03','2021-03-10 01:57:03'),(318,99,3,NULL,'Mengolah sampah organik dan an organik',1,'Istiqomah Nugraheni,S.Pd','1. Memberi edukasi kepada warga sekolah tentang bagaimana memperlakukan sampah dengan bijak\r\n2. Mengurangi sampah dilingkungan sekolah\r\n3. Mengelola sampah dengan 3R (reduce,reuse dan reycle)\r\n4. Mengolah sampah organik menjadi kompos','2021-03-10 02:59:33','2021-03-11 11:57:37'),(319,99,7,NULL,'Sistem budidaya ikan hemat air',4,'Agus Supriyanto,S.Pd','1. Merencakanan anggaran dan kegiatan budidaya ikan hemat air (sistem sirkulasi)\r\n2. Merencanakan sistem budidaya ikan hemat air (sistem sirkulasi)\r\n3. Melaksanakan budidaya ikan hemat air (sistem sirkulasi)\r\n4. Melakukan evaluasi atas kegiatan yang telah dilaksanakan sebagai acuan untuk budidaya berikutnya','2021-03-10 03:02:00','2021-03-11 03:57:47'),(320,99,9,NULL,'Tanaman Penghijauan',3,'Wahyu Sri Harjanti,S.Pd','1. Pembibitan tanaman\r\n2. Pengelompokan tanaman\r\n3. Menyirami secara rutin\r\n4. Pemberian pupuk secara berkala','2021-03-10 03:04:08','2021-03-11 04:25:56'),(323,56,1,NULL,'Mengolah sampah organik menjadi pupuk kompos',1,'Maulana Sriyono','Coba tambah dengan nama pokja sama','2021-03-11 02:11:37','2021-03-11 02:11:37'),(324,99,1,NULL,'Mengolah sampah organik menjadi pupuk kompos',1,'Wahyu Adi Kurniawan,S.Pd','1. Menyiapkan komposter dan kelengkapannya\r\n2. Menyiapkan tempat yang sesuai \r\n3. Menyiapkan Jadwal pelatihan produksi dan perawatan\r\n4. Panen dan pengemasan\r\n5. Pameran dan sosialisasi','2021-03-11 02:56:33','2021-03-11 03:44:06'),(325,99,4,NULL,'Gerakan menghemat penggunaan energi listrik',2,'Deny Saputra ,S.Pd','1. Menginventaris sumber listrik\r\n2. Melakukan audit energi sederhana \r\n3. Internalisasi hemat listrik\r\n4. Membentuk polisi energi\r\n5. Membuat pesan hemat energi ,poster dll','2021-03-11 02:59:47','2021-03-11 03:58:12'),(326,99,2,NULL,'Mengolah sampah an organik dengan 3R',1,'Feri Aryani,S.Pd','1. Memberi edukasi kepada warga sekolah tentang bagaimana memperlakukan sampah dengan bijak\r\n2. Mengurangi sampah dilingkungan sekolah\r\n3. Mengelola sampah dengan 3R (reduce,reuse dan reycle)\r\n4. Mengolah sampah organik menjadi kompos','2021-03-11 04:00:39','2021-03-11 04:00:39'),(327,99,21,NULL,'Menu beragam bergisi sehat aman ramah lingkungan',5,'Saptono,S.Kom','1.  Merencanakan kegiatan kantin ramah lingkungan\r\n2. Membuat kriteria kantin ramah lingkungan \r\n3. Pendampingan kepada pemilik kantin (operasional) ramah lingkungan\r\n4. Melakukan evaluasi secara berkala kegiatan kantin ramah lingkungan \r\n5. Menyusun laporan secara berkala kegiatan kantin ramah lingkungan','2021-03-11 04:03:36','2021-03-11 04:03:36'),(328,99,20,NULL,'Mengurangi penggunaan plastik di kantin',5,'Dra.Pinuk','memberikan edukasi untuk mengurangi penggunaan plastik dan pengunaan kemasan yng ramah lingkungan','2021-03-11 04:13:41','2021-03-11 04:13:41'),(329,99,8,NULL,'Merawat TOGA sekolah',3,'Dra.Sri Suratmi','1. Menanam TOGA dilahan belakang gedung sekolah\r\n2. Mendaftar nama-nama tanaman TOGA\r\n3. Mencatat dan memberi nama label TOGA serta khasiatnya\r\n4. Pengamatan,pencatatan dan pelaporan secara berkala\r\n5. Berperan aktif dalam menginformasikan TOGA serta manfaatnya kepada warga sekolah','2021-03-11 04:19:58','2021-03-11 04:25:20'),(330,99,18,NULL,'Tanaman Penghijauan',3,'Wahyu Sri Harjanti,S.Pd','Mendata jenis tanaman dari Kebun sekolah, hutan sekolah, taman sekolah, TOGA,pengadaan Greenhouse dan pengadaan fauna','2021-03-11 04:24:48','2021-03-11 04:24:48'),(331,99,10,NULL,'Menyebarluaskan informasi AMPL',4,'Saptono,S.Kom','1. Menyusun strategi dan program dalam pembangunan air minum sanitasi\r\n2. Pelestarian prasarana dan sarana drainase mandiri','2021-03-11 04:32:39','2021-03-11 04:32:39'),(332,99,11,NULL,'Mengubah sampah organik menjadi kompos',4,'Cucuk Witriyandoko,S.Pd','1. Membuat lubang biopori sekolah sebagai bantuan resapan air ke dalam tanah\r\n2. Mnegambil daun daun yang sudah menjadi kompos diganti dengan yang baru','2021-03-11 04:39:06','2021-03-11 11:35:32'),(333,99,12,NULL,'Memberikan tambahan air secara buatan',4,'Agus Supriyanto,S.Pd','1. Menyusun strategi dan program dalam pembangunan air minum sanitasi\r\n2. Pelestarian prasarana dan sarana drainase mandiri','2021-03-11 04:52:32','2021-03-11 04:52:32'),(334,99,5,NULL,'Mengonservasikan Energi di Sekolah',2,'Rominto Sady,S.Pd','1. Melakukan audit sederhana dan melakukan pengelolaan energi sehingga dapat diperoleh efisiensi penggunaan energi\r\n2. Mengembankan inovasi energi baik dari energi sampah, biopori, surya, angin dan air yang ada disekitar sekolah','2021-03-11 11:52:43','2021-03-11 11:52:43'),(335,99,13,NULL,'Menjaga kebersihan dan fungsi drainase di  sekolah',4,'Saptono,S.Kom','1. Membuat denah drainase di dalam sekolah\r\n2. Membimbing kader siswa dalam memantau dan merawat drainase\r\n3. Mensosialisasikan kegiatan ke warga sekolah dan publik khalayak\r\n4. Membuat event terkait hari air\r\n5. Menyusun pembelajaran jarak jauh tentang air dan sanitasi lingkungan','2021-03-11 12:08:00','2021-03-11 12:08:00'),(336,81,3,NULL,'Mengelola Sampah An Organik',1,'Deska natalia',